import React from 'react';
import InstagramEmbed from 'react-instagram-embed';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    container: {
        height: '100vh'
    },
    outerInsta: {
        position: 'absolute',
        marginLeft: '10vw',
        marginTop: '10vh',
        width: '24vw',
        overflow: 'hidden'
    },
    instagram: {
        height: '80vh',
        width: '25vw',
        overflowY: 'scroll',
        paddingRight: '-10vw'
    },
    facebook: {
        position: 'absolute',
        marginLeft: '40vw',
        marginTop: '16vh',
        width: '10vw'
    },
    blog: {
        marginLeft: '80vw',
        marginTop: '20vh',
    }
});

export default function SectionSocial(props) {
    const classes = useStyles();
    return (
        <div className={classes.container}>
            <div className={classes.outerInsta}>
                <div className={classes.instagram}>
                    <InstagramEmbed
                        url='https://www.instagram.com/p/B_SYE5VjswK/'
                        maxWidth={480}
                        hideCaption={false}
                        containerTagName='div'
                        protocol=''
                        injectScript
                        onLoading={() => { }}
                        onSuccess={() => { }}
                        onAfterRender={() => { }}
                        onFailure={() => { }}
                    />
                </div>
            </div>
            <div className={classes.facebook}>
                <iframe src="https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fsrmteamrudra%2Fphotos%2Fa.784896294862757%2F3129061607112869%2F%3Ftype%3D3&width=500" width="500" height="670" style={{ border: 'none', overflow: 'hidden' }} scrolling="no" frameborder="0" allowTransparency="true" allow="encrypted-media"></iframe>
            </div>
                <blockquote class="embedly-card" style={{marginLeft: '80vw !important', marginTop: '20vh'}}><h4><a href="https://medium.com/@srmmarsroverteam">Team Rudra - Medium</a></h4><p>Read writing from Team Rudra on Medium. RUDRA is an official robotics team of SRM Institute of Science and Technology that specializes in building mars rover prototypes.</p></blockquote>
        </div>
    );
}
